import styled from "styled-components";

import { ICoupon } from "@interfaces";
import { exchangedType } from "@configs";
import { useTranslation } from "react-i18next";

interface IProps {
    data: ICoupon;
}

export const ComponentHistoryCoupon = (props: IProps) => {
    //page hooks
    const { t } = useTranslation();
    //page props
    const { data } = props;
    console.log(data);
    return (
        <StyledContainer>
            <div className="coupon">
                <div className="title">{t("page.history.coupon_title")}</div>
                <div className="date">
                    <span className="status">
                        {data.exchangedType === exchangedType.RECEIVED ? "Collected" : "Used"}
                    </span>
                    <span className="time">23 July 2021</span>
                </div>
            </div>
            <div className="quality">+1</div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    padding: 18px 14px;
    display: flex;
    justify-content: space-between;
    align-items: end;
    .coupon {
        .title {
            font-weight: 600;
            font-size: 16px;
            line-height: 21px;
            color: #000000;
            margin-bottom: 4px;
        }
    }
    .date {
        font-weight: normal;
        font-size: 8px;
        line-height: 11px;
        color: #707070;
    }
`;
